window.bookSummaryJSON = "<p>For Bella Swan, there is one thing more important than life itself: Edward Cullen. But being in love with a vampire is even more dangerous than Bella ever could have imagined. Edward has already rescued Bella from the clutches of one evil vampire, but now, as their daring relationship threatens all that is near and dear to them, they realize their troubles may be just beginning.&nbsp;&nbsp;</p> <p>Legions of listeners entranced by the <i>New York Times</i> best-seller <i>Twilight</i> are hungry for the continuing story of star-crossed lovers Bella and Edward. In <i>New Moon</i>, Stephenie Meyer delivers another irresistible combination of romance and suspense with a supernatural spin. Passionate, riveting, and full of surprising twists and turns, this vampire love saga is well on its way to literary immortality.</p>"; 
